import logo from '../../assets/images/logo.svg';
import Typography from "@mui/material/Typography";
import Box from "@mui/material/Box";
import Input from '@mui/material/InputBase';
import x_button from '../../assets/images/x_button.svg';
import Link from '@mui/material/Link';
import Button from '@mui/material/Button';
import { styled } from '@mui/material/styles';
import { FormControl } from '@mui/material';

const StyledInput = styled(Input)({
    borderRadius: '1em',
    margin: 'auto',
    border: '3px solid #000000',
    fontSize: 'calc(0.8vw + 0.1em)'
});

export const SignUp = (props) => {
    return (
        <Box sx={{width:"100vw", height:"100vh", display:"flex", position:"absolute", justifyContent:"center", alignItems:"center"}}>
            <FormControl sx={{ width: '80vw', height: '80vh', background: 'white', borderRadius: 'calc(0.1em + 1vw)', border:"1px solid black", zIndex: '5', display:"flex", flexDirection:"column", alignItems:"center"}}>
                <Box sx={{display:"flex", justifyContent:"end", width:"100%"}}>
                    <img className='.login_x_button' style={{marginTop:"1vw", marginRight:"1vw"}} src={x_button} onClick={() => props.setRender((oldRender) => !oldRender)}></img>
                </Box>
                <img height="20%" width="auto" src={logo}></img>
                <StyledInput placeholder="Username" />
                <Button variant='contained' color='secondary'>Create Account</Button>
            </FormControl>
        </Box>
    )
}
